import React from 'react';
import './style.css';

function SignUpBtns () {
    return (
        <div className="two ui buttons">
            <button className="large ui green button">
                Login
            </button>
            <div class="or"></div>
            <button className="large ui blue button">
                Sign Up
            </button>
        </div>

    )
}

export default SignUpBtns;
